import React from 'react';
import CreateLesson from '../components/CreateLesson';
// import useAuth from '../auth/useAuth';
import Lessons from '../components/Lessons';

function Dashboard() {
	// const { user } = useAuth();
	const [getLessons, setGetLessons] = React.useState(false);

	return (
		<div>
			<div className='p-3'>
				<h1 className='text-3xl text-center lg:text-start'>Dashboard</h1>
			</div>
			<div className='flex flex-col p-10 items-center gap-5'>
				<div className=' flex justify-center'>
					<h2 className='text-xl text-center'>Upcoming Lessons</h2>
					<div className='self-end'>
						<CreateLesson
							getLessons={getLessons}
							setGetLessons={setGetLessons}
						/>
					</div>
				</div>

				<Lessons getLessons={getLessons} setGetLessons={setGetLessons} />
			</div>
		</div>
	);
}

export default Dashboard;
